import React from "react";

const steps = [
  "Upload XPT",
  "Domain Prediction",
  "SDTM Mapping",
  "Mapping QC",
  "Function Mapping",
  "Download",
];

const Steps = ({ activeStep, setActiveStep }) => {
  return (
    <div className="mt-6 border-b pb-2 flex space-x-6">
      {steps.map((step, index) => (
        <button
          key={index}
          className={`text-sm font-medium ${
            activeStep === index + 1 ? "text-red-500 font-bold border-b-2 border-red-500" : "text-gray-600"
          }`}
          onClick={() => setActiveStep(index + 1)}
        >
          Step {index + 1}: {step}
        </button>
      ))}
    </div>
  );
};

export default Steps;
